ation and Service) VRF','2019-08-27 00:18:27','2019-08-29 02:16:40','deb82624-ea05-47e4-aa7c-b8bb6b512d94',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(194,1910,1,'LG MLV01 (Installation and Service) VRF','2019-08-27 00:18:48','2019-08-29 02:16:40','89c4db50-5948-4559-8b05-d4e0b4f224b9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(195,1911,1,'LG MLV01 (Installation only) VRF','2019-08-27 00:19:02','2019-08-29 02:16:40','08953b08-298f-471d-8746-6b91832e03fe',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(196,1912,1,'Associated Partnerships','2019-08-29 00:30:27','2019-08-29 00:30:27','27fa3c2c-44f1-4d18-aace-d7a174c48ebd',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(197,1916,1,'Course #110-DDC Bootcamp','2019-08-29 00:41:38','2019-08-29 02:26:50','87e03162-f03d-4d64-b95f-910721c30bc2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'ACR Supply 4040 S. Alston Ave Durham NC, 27113',NULL,595.00,NULL,NULL,NULL,NULL,'<p>DDC Systems are in most commercial properties and can save the end user up to 38% on heating and cooling power bills. Training and educating your team to work on that end user DDC projects can help your bottom line. </p>\n\n<p>The course instructor is Ron Auvil! He has taught DDC controls for Johnson Controls and other leading DDC systems. Ron will help you understand the value in obtaining basic DDC system knowledge while understand function of basic components and how they work to control HVAC mechanical systems. </p>\n\n\n\n\n\n\n<ul><li>Prerequisite: None</li><li>Course Length: 2 Day 8am-4pm</li></ul>\n<p>	</p>\n<p><strong>Who the course is for:</strong></p>\n<ul>\n<li>New hires or for those just now coming into DDC Control Systems.</li>\n<li>HVAC service technicians</li>\n<li>Maintenance Staff, colleges, hospitals, and schools</li></ul><p><strong>Skills Learned:</strong></p>\n\n\n<ul>\n<li>Background and terminology for DDC.</li>\n<li>Overview of Commercial HVAC Systems such as VAV</li>\n<li>Introduction to basic programming types</li>\n<li>Log into a front end and perform typical tasks</li>\n<li>Basic Level 1 Troubleshooting skills</li>\n<li>Hands-On Labs.</li>\n</ul>\n<p><strong>About The Instructor:</strong></p>\n\n\n\n<p>Ron Auvil has 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’ and ‘HVAC Control Systems’ both from American Technical Publishers.</p>'),(198,1917,1,'Course #231-PCT Basics','2019-08-29 00:44:06','2019-08-29 02:28:11','ca652ede-8e72-4398-9d5f-eaf41ec78c81',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,'ACR Supply 4040 S. Alston Ave. Durham NC, 27713',NULL,NULL,NULL,NULL,NULL,NULL,'<p>This course is designed for those who need to know the basics of using the PCT Tool. </p>\n\n\n\n<p>Participants will receive an overview of the Facility Explorer MSTP Field Controller system, create programs from standard tree systems using the programmable Controller and Commissioning Tool, then connect using the MAP sensor to upload and download code into the controllers after setting up the hardware and software to communicate properly.</p>\n<p><strong>Note:</strong> All class room materials are provided. Lunch and snacks included.</p>\n\n\n<p>For End Users and/or Authorized Building Controls Specialists/Contractors only.</p>\n\n\n\n<ul><li>Prerequisite: None</li><li>Course Length: 2 Days 8am-4pm</li></ul>\n<p><strong>Topics:</strong></p>\n\n\n\n\n\n\n\n\n<ul><li>Introduction to the Facility Explorer MSTP Field Controllers System</li><li>PCT Software Basics</li><li>Using PCT Help</li><li>MSTP Controller Hardware</li><li>Creating Applications Using the Standards Tree</li><li>Adding Points to Existing Controllers</li><li>Using MAP sensor to Connect to Controllers; Discussion of Bluetooth Setup for BTCVT</li><li>Uploading and Downloading Controllers</li><li>Commissioning Controllers, Inputs and Outputs</li></ul>\n<p><strong>About The Instructor:</strong></p>\n\n\n\n<p>Ron Auvil has over 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’, ‘HVAC Control Systems’ and ‘IT for HVAC Technicians’, all both from American Technical Publishers..</p>'),(199,1918,1,'Course #304- Commercial HVAC Bootcamp','2019-08-29 00:47:09','2019-08-29 02:28:51','8006a671-63e1-46f5-b635-8be63cd5feff',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,'ACR Supply 200 Seneca Rd, Greensboro NC 27406',NULL,NULL,NULL,NULL,NULL,NULL,'<p>During this training your team will obtain an in-depth knowledge of typical commercial HVAC building systems. Identify major control system types and components. Save money with fewer service calls and complaints. Prepare technicians for advanced DDC and mechanical skills.</p>\n\n\n\n\n\n<ul><li>Prerequisite: None</li><li>Course Length: 2 Day 8am-4pm</li></ul>\n<p><strong>Who the course is for:</strong></p>\n\n\n\n\n<ul>\n<li>New hires, especially residential technicians now working in a commercial building environment. </li>\n<li>HVAC service technicians</li>\n<li>Maintenance Staff, colleges, hospitals, and schools</li>\n</ul>\n<p><strong>Skills Learned:</strong></p>\n\n\n\n<ul>\n<li>Importance of comfort in commercial buildings. </li>\n<li>Typical commercial building HVAC systems with emphasis on VAV.</li>\n<li>Hot water and chilled water piping systems including 2 pipe changeover and primary secondary.</li>\n<li>Typical chiller plant sequence of operation.</li>\n<li>Chiller and cooling tower operation.</li>\n<li>Commercial boiler types and operation. </li>\n<li>Control system components, including inputs, outputs, and control loops.</li>\n<li>Air handler types and configurations.</li>\n<li>Economizer control types.</li>\n<li>Hands on labs.</li>\n</ul>\n<p><strong>About The Instructor:</strong></p>\n\n\n<p>Ron Auvil has 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’ and ‘HVAC Control Systems’ both from American Technical Publishers.</p>'),(200,1919,1,'Course #204-Pneumatic HVAC Controls','2019-08-29 02:20:30','2019-08-29 02:31:16','58771cfe-d8b0-468c-bad7-a30b7f15041a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,'ACR Supply 200 Seneca rd., Greensboro NC 27406',NULL,NULL,NULL,NULL,NULL,NULL,'<p>Pneumatic Control Systems make up approximately 20% of all controls in commercial buildings today. Unfortunately, many of the technicians that worked on these systems have retired. </p>\n<p>The course instructor is Ron Auvil! He has taught pneumatic controls for both Honeywell and Johnson Controls. This course will be chock full of practical field insights that technicians need to know to maintain and troubleshoot their pneumatic control systems. It will cover multiple manufacturers and generations of controls. </p>\n<ul><li>Prerequisite: None</li><li>Course Length: 1 Day 8am-4pm</li></ul>\n<p><strong>COURSE TOPICS:</strong></p>\n<ul><li>Air Compressor Station and Maintenance</li>\n<li>Pneumatic Actuators, Dampers and Valves</li>\n<li>Pneumatic Thermostats; 1 and 2 pipe; Day/Night and Winter/Summer Thermostats</li>\n<li>Thermostat Calibration Procedures </li>\n<li>Humidistats and Pressure stats</li>\n<li>Pneumatic Transmitters</li>\n<li>Pneumatic Receiver Controllers; 1 and 2 input types</li>\n<li>Receiver Controller Calibration Procedures</li>\n<li>Auxiliary Devices</li>\n</ul>\n<p><strong>About The Instructor:</strong></p>\n<p>Ron Auvil has 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’ and ‘HVAC Control Systems’ both from American Technical Publishers. </p>');
