INSERT INTO `acr_matrixcontent_services` VALUES (1,12,1,'2018-11-02 02:36:30','2019-08-26 15:54:11','ef6ec637-82b0-4cdf-a14e-0927429e01ad','Our “Roots”','ACR Supply started with a door stacked on top of antifreeze boxes for a desk in 1977 by LC Meachum. We have grown into a regional HVAC/R industry wholesaler homebased in Durham NC. We offer over 15,000 SKUs and support thousands of customer partnerships through six sales channels. ACR understands that serving our customers with custom solutions that line up with their business model, makes all the difference.','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"Shop Online\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null}'),(2,13,1,'2018-11-02 02:36:30','2019-08-26 15:54:11','ee0c8373-1022-4ffb-9351-a31c8d9701b4','Our “Why”','ACR Cares partners with charities supporting local communities as well as orphanages in Burkina Faso and is a main focus for our ACR team members. ACR’s purpose “Building Relationships, Impacting Lives, Glorifying God” is the foundation by which we do business. Separating your faith on Sunday from work on Monday is impossible to do.','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null}'),(3,14,1,'2018-11-02 02:36:30','2019-08-26 15:54:11','4aa9d87f-fb31-4e1d-8b3a-05df0cf08c28','Our “Culture”','ACR realizes we spend more time in our careers than at home. “We are building a culture that everyone that works at ACR can get up every morning and enjoy coming to work” Troy Meachum, Chief Cheerleader. Work can be fun if you know “Why” you are there and by serving a cause bigger than you.','{\"ariaLabel\":null,\"customQuery\":null,\"customText\":\"\",\"target\":null,\"title\":null,\"type\":\"entry\",\"value\":null}'),(4,326,1,'2019-08-25 00:19:59','2019-08-25 00:19:59','5d810eea-ef3f-4892-8c58-8344e2292d39','Thousands of Products','ACR Supply started with a door stacked on top of antifreeze boxes for a d