-9e78731a9ae4','ok'),(214,1469,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','10761b0a-f471-420f-afd9-335cddfe8eaf','One of family and friends.'),(215,1470,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','57c5d6b8-492a-4c29-887b-0b217900093b','One that values relationships with customers and team members alike.'),(216,1471,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','f8f7ecba-0f83-4b42-aa97-eda40ee25f58','Open and Caring'),(217,1472,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','c9bc7d01-d93c-4449-8e63-db2f097373a9','Our culture at work provides a road map for life.'),(218,1473,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','c31423e2-fdf9-4190-a478-a6a6091eaab7','Our culture is positive, forward thinking and we truly care about one another and the impact we have on each other\'s lives and each other\'s families.'),(219,1474,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','23044503-5095-4b86-ad9d-578ff26a2ae3','People liking and respecting one another, with the end goal to satisfy our customers.'),(220,1475,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','483c5845-fe06-4c0f-adb4-75bf54093f52','professional, unique, kind, smart, trust'),(221,1476,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','50860578-a15b-4be1-af12-4a6ac1f64d3a','Refreshing'),(222,1477,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','e66213a0-55c6-49c6-8b16-30348863f4a4','Rewarding personally and professionally'),(223,1478,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','54b7f524-c788-42a1-b03c-814022aee5d2','Spiritual'),(224,1479,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','00a0f144-af4e-490e-8fa8-c564038f446e','take care of customer at all cost'),(225,1480,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','90bb6c5e-0f63-42d6-b048-e6ff0cfaf912','The ACR Culture is phenomenal, I have never worked at a place like this before. Everyone seems to be very helpful, Family oriented and has a Purpose for doing whats best for ACR.'),(226,1481,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','e10def95-9253-477d-9d3d-145993e06e40','The culture at ACR is amazing I love the fact that the companies principal includes to glorify god.'),(227,1482,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','d4ed459e-da56-4a1d-8e69-78ad8de8a1a1','The culture at ACR is one of serving customers first by working together and also by helping its employees to be better trained within their own fields.'),(228,1483,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','a657d983-1a10-42ee-b930-7d6dc6fed9c0','The culture at ACR Supply is like we\'re all a family.'),(229,1484,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','95c73b79-eab3-420b-830f-c3ccd253344c','The culture has improved over the past few years.'),(230,1485,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','3c8914c7-14b1-44ca-8150-fa04b800b275','The culture is not always applied the same'),(231,1486,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','c4bafcc8-062b-4639-8074-bed3b3d0c667','The culture of this company is awesome. Everyone is loved, and part of the team.'),(232,1487,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','bf932e27-f6f9-4e9c-93b5-583254e1e3a3','Unique, I treasure this place, best job I\'ve ever had.'),(233,1488,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','27e17348-4919-4596-a8d4-4d5f7a246bc9','Values, beliefs, attitudes, and behaviors share each day at work.'),(234,1489,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','acd07a96-dee6-45f2-a476-1854ce660e30','VISIONARY'),(235,1490,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','d357c377-a3be-4526-813a-5cf7bff5d061','Visionary leaders everywhere with a humble servant leadership mindset with a mission to fulfill God\'s purposes in our sphere\'s of influence while making a profit for the future!  SEE BIG while thinking SMALL'),(236,1491,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','47ee8796-7b60-4789-91f8-646007bc4d46','We are a family that loves, cares for, and prays for one another and our communities.'),(237,1492,1,'2019-08-25 00:20:33','2019-08-25 00:20:33','5e572862-de08-4cd0-9748-28ce5e8da887','We care for each other');
