aintenance staff colleges hospitals and schoolsskills learned background and terminology for ddc overview of commercial hvac systems such as vav introduction to basic programming types log into a front end and perform typical tasks basic level 1 troubleshooting skills hands on labs about the instructor ron auvil has 40 years of hvac and controls experience he has worked as a senior controls technician for johnson controls he has also taught hvac and controls classes across the united states for johnson controls honeywell and others he has written several textbooks hvac and refrigeration systems and hvac control systems both from american technical publishers '),(1917,'field',69,1,' this course is designed for those who need to know the basics of using the pct tool participants will receive an overview of the facility explorer mstp field controller system create programs from standard tree systems using the programmable controller and commissioning tool then connect using the map sensor to upload and download code into the controllers after setting up the hardware and software to communicate properly note all class room materials are provided lunch and snacks included for end users and or authorized building controls specialists contractors only prerequisite nonecourse length 2 days 8am 4pm topics introduction to the facility explorer mstp field controllers systempct software basicsusing pct helpmstp controller hardwarecreating applications using the standards treeadding points to existing controllersusing map sensor to connect to controllers discussion of bluetooth setup for btcvtuploading and downloading controllerscommissioning controllers inputs and outputs about the instructor ron auvil has over 40 years of hvac and controls experience he has worked as a senior controls technician for johnson controls he has also taught hvac and controls classes across the united states for johnson controls honeywell and others he has written several textbooks hvac and refrigeration systems hvac control systems and it for hvac technicians all both from american technical publishers '),(1918,'field',69,1,' during this training your team will obtain an in depth knowledge of typical commercial hvac building systems identify major control system types and components save money with fewer service calls and complaints prepare technicians for advanced ddc and mechanical skills prerequisite nonecourse length 2 day 8am 4pm who the course is for new hires especially residential technicians now working in a commercial building environment hvac service technicians maintenance staff colleges hospitals and schools skills learned importance of comfort in commercial buildings typical commercial building hvac systems with emphasis on vav hot water and chilled water piping systems including 2 pipe changeover and primary secondary typical chiller plant sequence of operation chiller and cooling tower operation commercial boiler types and operation control system components including inputs outputs and control loops air handler types and configurations economizer control types hands on labs about the instructor ron auvil has 40 years of hvac and controls experience he has worked as a senior controls technician for johnson controls he has also taught hvac and controls classes across the united states for johnson controls honeywell and others he has written several textbooks hvac and refrigeration systems and hvac control systems both from american technical publishers '),(1919,'id',0,1,' 1919 '),(1919,'title',0,1,' course 204 pneumatic hvac controls '),(1919,'startdate',0,1,' 2019 10 15 00 00 00 '),(1919,'enddate',0,1,' 2019 10 15 23 59 59 '),(1919,'slug',0,1,' course 204 pneumatic hvac controls '),(1919,'field',69,1,' pneumatic control systems make up approximately 20% of all controls in commercial buildings today unfortunately many of the technicians that worked on these systems have retired the course instructor is ron auvil he has taught pneumatic controls 